MGCAddSnippet(4, "UCDB API is an application programming interface for the Unified Coverage Database included in the Questa SIM and ModelSimSE products. The UCDB and its API are completely independent of Questa and ModelSim, however UCDBs are easily created with these tools. In this document, the term Questa refers to both the Questa and the ModelSim SE systems. ");
MGCAddSnippet(5, "This section provides information about scopes and coveritems, design unit scopes, and UCDB scope types so that you have a good understanding of the structure of a UCDB file.");
MGCAddSnippet(6, "Designs and testbenches are hierarchically organized. Design units (Verilog modules or VHDL entity/architectures), testplans, and coverage data (of which the SystemVerilog covergroup is the best example) can all be hierarchical. Therefore, the UCDB needs some general way to store hierarchical structures.");
MGCAddSnippet(7, "For representing an HDL design, a simple hierarchy is not sufficient. The design units must also be represented. ");
MGCAddSnippet(8, "Because the UCDB needs to distinguish between module instances, design units, and even other scopes like those for covergroups and coverpoints, the UCDB has a scope type associated with every scope. This scope type is the C type ucdbScopeTypeT.");
MGCAddSnippet(9, "The UCDB API is a general one that creates certain objects  such as scopes, coveritems, and test data records  with certain names, types, and attributes. Use of this API allows for the creation of many different potential data models.");
MGCAddSnippet(10, "Questa creates code coverage roll-ups (the aggregation of design-unit-based coverage from instances of those design units) implicitly when the database is loaded into memory.");
MGCAddSnippet(11, "The UCDB reports statement coverage data of your design as a coveritem with no hierarchy.");
MGCAddSnippet(12, "Branch coverage is based on the common coding styles of Verilog if-else, VHDL if-elsif-else, and Verilog and VHDL case statements.");
MGCAddSnippet(13, "The data model represents both expression coverage, the truth table coverage for an expression used to drive a continuous assignment, and condition coverage, the truth table coverage for an expression in a branch.");
MGCAddSnippet(14, "The UCDB represents a Finite State Machine (FSM) as a two-level hierarchy of coverage scopes.");
MGCAddSnippet(15, "The UCDB data model for toggle coverage represents, the six basic types of toggle coverage: integer, enum, register, net, extended register, and extended net.");
MGCAddSnippet(16, "The UCDB data model provides a definition of group information.");
MGCAddSnippet(17, "Cover directives in PSL or cover statements in SystemVerilog Assertions language are exactly the same in Questa. (Both are referred to as  cover directives  in Questa.)");
MGCAddSnippet(18, "The UCDB data model for assertions maintains different counts in different circumstances. ");
MGCAddSnippet(19, "This section describes types of covergroup coverage, including covergroup with a cross, sparse cross bin representation, CROSSSBINIDX and CROSSUBINIDX, covergroup with per-instance coverage, and embedded covergroups.");
MGCAddSnippet(20, "The UCDB provides a data model specific to covergroups containing a cross.");
MGCAddSnippet(21, "The UCDB only counts cross bins with non-zero coverage, resulting in a more efficient database.");
MGCAddSnippet(22, "The UCDB data model for cross bins relies on user-defined attributes and only apply when using the $load_coverage_db() system task.");
MGCAddSnippet(23, "The UCDB data model supports the scenario of a covergroup with per-instance coverage along with a covergroup within a package.");
MGCAddSnippet(24, "The UCDB data model provides information for when you embed covergroups within a class.");
MGCAddSnippet(25, "The output of ucdbdump shows some of the data associated with a design unit, with which you can analyze coverage information about your design units.");
MGCAddSnippet(26, "In earlier versions of the database and API, there were only test data records which were designed to record information about the test run which produced the UCDB. It is not possible to create a UCDB without a test data record. When test data records were later extended, they became a special case of the history node. The history node records information about any process that creates a UCDB.");
MGCAddSnippet(27, "Understanding the UCDB data models is a prerequisite to using the API. The API is more general than the specific data models used to represent specific kinds of coverage. It is also important to know how to use the API and understand some specific use scenarios.");
MGCAddSnippet(28, "You can open a UCDB file in various modes enabling different methods of analysis. ");
MGCAddSnippet(29, "Most API calls return status or invalid values in case of error. However, these error return cases give no extra information about error circumstances. It is recommended that all standalone applications install their own UCDB error handler. If the API application is linked with Questa, installation of an error handler will not be allowed because Questa already is linked with one.");
MGCAddSnippet(30, "The ucdb_CallBack() function is a versatile function that is only available in-memory: given a scope pointer (NULL in this case, meaning traverse the entire database) it traverses everything recursively. ");
MGCAddSnippet(31, "The read coverage data example illustrates how to read coverage counts for all coveritems in all instances of a database. This is also based upon the ucdb_CallBack() function for traversing the entire database in memory.");
MGCAddSnippet(32, "The easiest way in the UCDB API to find particular objects by name in the database is the ucdb_PathCallBack() function. It has the added advantage of handling wildcards for multiple characters (*) and a single character (?) in individual path component names.");
MGCAddSnippet(33, " You can apply ucdb_IncrementCover to statement coveritems if their parent scopes are identified. To increment a coveritem multiple times, it is recommended that you save a scope pointer and coverindex for later use. The ucdb_PathCallBack() approach has the disadvantage that it only recognizes named items, which excludes statement coveritems.");
MGCAddSnippet(34, "The ucdb_RemoveScope() and ucdb_RemoveCover() functions are used to delete objects from the database. ");
MGCAddSnippet(35, "Tags are names that are associated with scopes and test data records in the database. You can use these names could for general purpose grouping in the database. ");
MGCAddSnippet(36, "The ucdb_PathCallBack() function automatically performs a recursive traversal of testplan scopes, and for each testplan scope, it pursues the linked objects that share the same tag. The function considers the linked objects to be virtual children of the testplan scope. ");
MGCAddSnippet(37, "File representation in the UCDB is designed to be efficient and capable. For efficiency, inside most objects in the database source file information is stored as: file number, line number, and token number. File numbers need to relate to a file table. The UCDB has various ways to create a file table, implicitly or explicitly. ");
MGCAddSnippet(38, "The single complex example  create-ucdb/create_ucdb.c  creates a hardcoded UCDB from scratch. The code that it uses could be adapted, with variations, to add objects to an existing UCDB. Even in the  create_ucdb.c  example, the database exists; it just starts out empty and is added to with each call.");
MGCAddSnippet(39, "This is an example of creating test data that is nearly identical to that created automatically by Questa for the  create-ucdb  example. The differences are in the date and userid, which cannot be reproduced because those will vary according to who runs the example and when.");
MGCAddSnippet(40, "This is the top-level code that calls all of the functions. ");
MGCAddSnippet(41, "Read-streaming mode is a callback-based traversal of a UCDB as laid out on disk. It has the advantage of reducing memory overhead, as the UCDB is never fully loaded into memory.");
MGCAddSnippet(42, "Write-streaming mode is a way of writing a UCDB with optimally low memory overhead. ");
MGCAddSnippet(43, "If you have a model linked with the simulation kernel through PLI, VPI, or FLI, you can use the Questa coverage save command for a transparent integration of coverage data. ");
MGCAddSnippet(44, "the UCDB does not exist as a memory image in simulation. Coverage data in simulation is intricately linked into the simulation context tree (hierarchical name-based data structure), and is only extracted on demand and written, using a wrapper around the UCDB API write-streaming mode, to disk. ");
MGCAddSnippet(45, "The mti_AddUCDBSaveCB callback is designed to work on only one  region  (or scope: a module instance in the example.) This means that if you have data in multiple scopes, you must install the callback multiple times. However, you only need to install the callback for as many scopes as you have coverage data to contribute. ");
MGCAddSnippet(46, "These compatibility commitments are made by Questa and its implementation of the UCDB API.");
MGCAddSnippet(47, "This section defines the UCDB API functions by function group.");
MGCAddSnippet(48, "Every UCDB object can have a source filename stored with it. Different applications have different requirements for how these are stored. Consequently, the UCDB contains an object called a  filehandle,  which provides a way of storing indirect references to filenames.");
MGCAddSnippet(49, "The most convenient error-handling mode is to use ucdb_RegisterErrorHandler() before any UCDB calls. The user s error callback, a function pointer of type ucdb_ErrorHandler, is called for any error produced by the system. ");
MGCAddSnippet(50, "If a UC database was created as a result of a single test run, the database has a single test data record associated with it. If it was created as a result of a test merge operation, the UC database should have multiple sets of test data. The functions defined in this section can be used to create sets of test data. Each test data record should be associated with the name of the UC database  file in which the database was first stored.");
MGCAddSnippet(51, "A UCDB database exists in two forms: an in-memory image accessible with a database handle, and a persistent form on the file system. There are read-streaming and write-streaming modes that minimize the memory usage in the current process. These streaming modes keep only a small window of data in memory; and after you have moved onward in reading or writing, you cannot revisit earlier parts of the database. Random access is not possible.");
MGCAddSnippet(52, "User-defined attributes are associated with objects in the database (scopes, coveritems, or tests) or with the database itself (global attributes). They are key-value pairs that can be traversed or looked up by key. ");
MGCAddSnippet(53, "Scopes functions manage the design hierarchy and coverage scopes. The UCDB database is organized hierarchically in parallel with the design database, which consists of a tree of module instances, each of a given module type. ");
MGCAddSnippet(54, "The summary coverage statistics interface enables quick access to aggregated coverage and statistics for different kinds of coverage, and some overall statistics for the database.");
MGCAddSnippet(55, "This section lists cover types, coveritem types, and flags for cover item data.");
MGCAddSnippet(56, "Toggles are the most common type of object in a typical code coverage database. Therefore, they have a specific interface in the API that can be restricted for optimization purposes. Net toggles can be duplicated throughout the database through port connections. They can be reported once rather than in as many different local scopes as they appear (this requires a net id).");
MGCAddSnippet(57, "Groups are used to maintain bus structures in the database. They provide additional support for part-select toggle nodes, particularly with the support for wildcard ranges provided by group scopes.");
MGCAddSnippet(58, "A tag is a group of strings associated with a scope. Scopes can have associated tags for grouping; when items share a tag they are associated together. In particular, when UCDB_TESTPLAN scopes share tags with coverage scopes that contain coveritems, the association can be used to do traceability analysis tests. ");
MGCAddSnippet(59, "A UCDB test is the result of functional verification analysis performed by a simulator or a formal verification tool. A formal test is a ucdbTestT object that is also associated with special information that describes a particular formal analysis session (ucdb_AssocFormalInfoTest).");
MGCAddSnippet(60, "API for associating tests and coverage objects. Coveritems or scopes may be associated with one of the ucdbTestT records in the database through this API.");
MGCAddSnippet(61, "A UCDB file is organized into two sections: test and coverage.");
MGCAddSnippet(62, "The test section of a UC database contains information about the test or set of tests that were used to generate the coverage data. If the file was created by merging multiple databases, the database contains multiple test records. ");
MGCAddSnippet(63, "The coverage section of a UC database contains the coverage data, organized in a hierarchy of scopes related to the design, testbench, and testplan.");
MGCAddSnippet(64, "Coverage data in the database form a tree of nodes, called scopes, generally corresponding to the design hierarchy. All nodes except the root node have a pointer to their parent. If the design hierarchy is not relevant to coverage, it need not be represented in the UCDB.");
MGCAddSnippet(65, "Coveritems (coverage items) are always children of parent scopes and each coverage item is only accessible through its parent scope. This property of a UCDB enables optimizations related to efficiently storing a sets of coverage items that always lie in certain scopes.");
MGCAddSnippet(66, "The UCDB does some light enforcement of HDL nesting rules, but strictly enforces nesting rules for coverage scopes, coveritems and testplan scopes. ");
MGCAddSnippet(67, "UCDB attributes provide a faster access mechanism for some frequently accessed attributes, compared to user-defined attributes. ");
MGCAddSnippet(68, "This appendix has the BNF definition of the UCDB sytntax.");
MGCAddSnippet(69, "UCDB Diff BNF Definition.");
